"use strict";
module.exports = JSON.parse('[{"badgeId":"148debcf-a348-4ea8-9d19-68fedf32181b","badgePublicUrl":"https://www.credly.com/badges/148debcf-a348-4ea8-9d19-68fedf32181b/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFD121: Developing Secure Software","details":"Earners of the LFD121: Developing Secure Software badge know the practical steps that must be taken to counter most kinds of attacks. Using these steps, they create and maintain systems that are much harder to successfully attack, reduce the damage when attacks are successful, and speed up the response so that any latent vulnerabilities can be rapidly repaired.","issuedBy":"The Linux Foundation","issuedOn":"August 18, 2023"},{"badgeId":"34b157e3-dee4-4558-9ce6-b79a7a7ede5d","badgePublicUrl":"https://www.credly.com/badges/34b157e3-dee4-4558-9ce6-b79a7a7ede5d/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC110: Fundamentals of Professional Open Source Management","details":"Earners of the LFC110: Fundamentals of Professional Open Source Management badge understand the key phases of developing a Professional Open Source Management program, including open source management strategy, open source management policy development, and open source management process development.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"62b002b2-b149-4203-9558-3e267ed0b5f4","badgePublicUrl":"https://www.credly.com/badges/62b002b2-b149-4203-9558-3e267ed0b5f4/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC191: Open Source Licensing Basics for Software Developers","details":"Earners of the LFC191: Open Source Licensing Basics for Software Developers badge possess a good working knowledge of open source licensing and compliance. They can distinguish the different types of licenses and permissions, and are able to create file notices with copyrights and licenses.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"343849b6-4fd5-4e44-88d9-335ed78070db","badgePublicUrl":"https://www.credly.com/badges/343849b6-4fd5-4e44-88d9-335ed78070db/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC193: Introduction to Open Source Licensing Compliance Management","details":"Earners of the Introduction to Open Source License Compliance Management (LFC193) badge have the necessary skills to start building an effective open source license compliance program. They understand the fundamentals of intellectual property, open source licensing and the basic processes used to manage these matters. They can understand how licensing aligns with existing company practices and where the company may need to invest resources into refining processes, policy or training.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"9002a39c-8d46-4d26-830f-67dc0a1833ea","badgePublicUrl":"https://www.credly.com/badges/9002a39c-8d46-4d26-830f-67dc0a1833ea/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC194: Implementing Open Source License Compliance Management","details":"Earners of the Implementing Open Source License Compliance Management (LFC194) badge understand what license compliance management is, why it is important to conduct an open source review and who is involved in this process and why. They can also follow the steps necessary to achieve end-to-end compliance and are familiar with developer guidelines that are recommended to be followed when using open source code and contributing to open source projects and communities.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"814f3fe1-2112-4191-b94d-9fb7e9eecbe1","badgePublicUrl":"https://www.credly.com/badges/814f3fe1-2112-4191-b94d-9fb7e9eecbe1/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC192: Generating a Software Bill of Materials","details":"Earners of LFC192: Generating a Software Bill of Materials badge can identify the minimum data elements for a SBOM and understand the reasoning behind why those elements are included in an SBOM. They have foundational knowledge about the options and the tools available for generating SBOMs. By knowing how to generate an SBOM, they are better equipped to help with efficient analysis for security, licensing, and other use cases.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"6d07bfda-39c0-474e-ad18-b0a2d9e86fac","badgePublicUrl":"https://www.credly.com/badges/6d07bfda-39c0-474e-ad18-b0a2d9e86fac/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC108: Cybersecurity Fundamentals","details":"Earners of the LFC108: Cybersecurity Essentials badge can apply security practices and precautions during online activities to minimize risks and securely protect personal and professional information from exposure and compromise. They can also identify what to do if a data breach occurs.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"d2fac373-024a-4300-8c1a-2dee7b0a8dbe","badgePublicUrl":"https://www.credly.com/badges/d2fac373-024a-4300-8c1a-2dee7b0a8dbe/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC104: Ethics for Open Source Development","details":"Earners of the LFC104: Ethics for Open Source Development badge can work comfortably and productively on ethically sensitive open source technology. They have a good understanding of the ethics journey cycle and can practically utilize the methodology in any open source use case. They can operationalize ethics as a decision-making tool, work collaboratively with open source communities to develop ethically sound technology, and lead a team through the ethics journey cycle.","issuedBy":"The Linux Foundation","issuedOn":"August 16, 2023"},{"badgeId":"210cfe9b-1ca8-47c6-8347-37f658781caa","badgePublicUrl":"https://www.credly.com/badges/210cfe9b-1ca8-47c6-8347-37f658781caa/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC103: Inclusive Strategies for Open Source","details":"Earners of the LFC103: Inclusive Strategies for Open Source course can identify and execute specific strategies to improve diversity in their open source communities. They understand the impact of inclusive language in creating welcoming community spaces.","issuedBy":"The Linux Foundation","issuedOn":"August 15, 2023"},{"badgeId":"ee4e716c-ee8d-4d02-9ce1-3efbb5a84ed6","badgePublicUrl":"https://www.credly.com/badges/ee4e716c-ee8d-4d02-9ce1-3efbb5a84ed6/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC131: Green Software for Practitioners","details":"Earners of the LFC131: Green Software for Practitioners badge understand the principles of green software and know how to apply green software principles to the design and development of their software applications. They have a good understanding of the shared language and standardized terms related to green software. They acknowledge the importance of measurement and are aware of the different climate commitments which constitute the mechanism of carbon reduction.","issuedBy":"The Linux Foundation","issuedOn":"August 15, 2023"},{"badgeId":"83a42ab9-f3d2-473d-998a-a5c6cc06213c","badgePublicUrl":"https://www.credly.com/badges/83a42ab9-f3d2-473d-998a-a5c6cc06213c/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC101: Inclusive Speaker Orientation","details":"Earners of the LFC101: Inclusive Speaker Orientation badge possess knowledge and practical skills to promote inclusivity in presentations, messaging and other communications. They understand the importance of diversity in technology and its role in encouraging innovation. These candidates are able to recognize the different ways unconscious and societal biases present themselves in technical environments.","issuedBy":"The Linux Foundation","issuedOn":"August 15, 2023"},{"badgeId":"f14e1558-2430-4835-b32a-ec8c3e754ca3","badgePublicUrl":"https://www.credly.com/badges/f14e1558-2430-4835-b32a-ec8c3e754ca3/public_url","badgeImageUrl":"/static/img/badges/Linux_Foundation_OS_Best_Practices.png","title":"LFC102: Inclusive Open Source Community Orientation","details":"Earners of the LFC102: Inclusive Open Source Community Orientation understand the importance of diversity for innovation, the basics of unconscious and societal bias, and how to recognize the different ways unconscious bias presents itself in technical environments.","issuedBy":"The Linux Foundation","issuedOn":"August 15, 2023"},{"badgeId":"c2f8a0ba-ea8e-4380-a3f4-938cc652c5c3","badgePublicUrl":"https://www.credly.com/badges/c2f8a0ba-ea8e-4380-a3f4-938cc652c5c3/public_url","badgeImageUrl":"/static/img/badges/AWS-Security-Specialty-2020.png","title":"AWS Certified Security - Specialty","details":"Earners of this certification have an in-depth understanding of AWS security services and the shared responsibility model (between AWS and the customer). They demonstrated the ability to design, implement, and troubleshoot various security models in the AWS Cloud.","issuedBy":"Amazon Web Services Training and Certification","issuedOn":"September 23, 2021"},{"badgeId":"c0bd08c8-3d58-4039-802d-87651ff8f925","badgePublicUrl":"https://www.credly.com/badges/c0bd08c8-3d58-4039-802d-87651ff8f925/public_url","badgeImageUrl":"/static/img/badges/AWS-Developer-Associate-2020.png","title":"AWS Certified Developer - Associate","details":"Earners of this certification have a comprehensive understanding of application life-cycle management. They demonstrated proficiency in writing applications with AWS service APIs, AWS CLI, and SDKs; using containers; and deploying with a CI/CD pipeline.","issuedBy":"Amazon Web Services Training and Certification","issuedOn":"September 18, 2021"},{"badgeId":"7bc0b126-74ee-4a7a-a616-17eaf18f0cf8","badgePublicUrl":"https://www.credly.com/badges/7bc0b126-74ee-4a7a-a616-17eaf18f0cf8/public_url","badgeImageUrl":"/static/img/badges/AWS-SolArchitect-Associate-2020.png","title":"AWS Certified Solutions Architect - Associate","details":"AWS Certified Solutions Architect - Associate showcases knowledge and skills in AWS technology, across a wide range of AWS services. The focus of this certification is on the design of cost and performance optimized solutions, demonstrating a strong understanding of the AWS Well-Architected Framework. This certification can enhance the career profile and earnings of certified individuals and increase your credibility and confidence in stakeholder and customer interactions.","issuedBy":"Amazon Web Services Training and Certification","issuedOn":"September 18, 2021"},{"badgeId":"21656fbc-71f3-4c99-ac9a-251c76d11820","badgePublicUrl":"https://www.credly.com/badges/21656fbc-71f3-4c99-ac9a-251c76d11820/public_url","badgeImageUrl":"/static/img/badges/AWS_Certified_Cloud_Practitioner_Badge.png","title":"AWS Certified Cloud Practitioner","details":"Earners of this certification have a fundamental understanding of IT services and their uses in the AWS Cloud. They demonstrated cloud fluency and foundational AWS knowledge. Badge owners are able to identify essential AWS services necessary to set up AWS-focused projects.","issuedBy":"Amazon Web Services Training and Certification","issuedOn":"July 10, 2021"},{"badgeId":"a18ffdd5-d2d0-4b23-b040-732598711b1a","badgePublicUrl":"https://www.credly.com/badges/a18ffdd5-d2d0-4b23-b040-732598711b1a/public_url","badgeImageUrl":"/static/img/badges/Programming_in_HTML5_with_JavaScript_and_Css3-01_Badge.png","title":"Exam 480: Programming in HTML5 with JavaScript and CSS3","details":"Candidates for this exam are developers with at least one year of experience developing with HTML in an object-based, event-driven programming model, and programming essential business logic for a variety of application types, hardware, and software platforms using JavaScript.","issuedBy":"Microsoft","issuedOn":"March 03, 2013"}]');

